import React from 'react';

export const About = () => {


    return (
        <div class='about'>
            <h1 class='name'>Paul Huang</h1>
            <section class='description'>
                <h3>About Me: </h3>
                <p style={{textIndent: '2em'}}>
                    {"I am currently a CS student at Simon Fraser University.\n"
                    + "I am an aspiring computer scientist who is mainly interested in the field of artificial intelligence"}
                </p>
            </section>

            <section class='education'>
                <h3>Education :</h3>
                <ul>
                    <li>(BSc) Mathematics and Computing Science Joint Major - <i>in progress</i></li>
                </ul>
            </section>
        </div>
    );
}
